INSERT INTO `units` (`id`, `title`, `body`, `slug`, `created_at`, `subcategory_id`, `unit_img`, `user_id`, `resources`) VALUES
(41, 'Basics of Computer Graphics', '<h2><strong>Major Areas of Computer Graphics</strong></h2>\r\n\r\n<p>Understanding of Computer Graphics and apply its thories into practice requires solid foundation in Math linear algebra for modeling objects, and Physics about lighthing and many more.</p>\r\n\r\n<p><strong>Modeling: S</strong>pecification of shape and appearnce properities mathematically so that it can be stored on computer.</p>\r\n\r\n<p><strong>Rendering: </strong>Drawing pixels onto computer screen much like cathod ray tube.</p>\r\n\r\n<p><strong>Image processing </strong>deals with the manipulation of 2D images and is used in both the fields of graphics and vision.</p>\r\n\r\n<p><strong>Major Applications</strong></p>\r\n\r\n<ul>\r\n	<li>Medical Imaging e.g Computed Tempgraphy&nbsp;</li>\r\n	<li>Information visulazation</li>\r\n	<li>Video games</li>\r\n	<li>Similation: e.g air filight simulation for trainee pilots</li>\r\n</ul>\r\n\r\n<h3><strong>Graphics APIs</strong></h3>\r\n\r\n<p>Standard collection of functions that perform operations like drawing images and 3D surfaces into windows on the screen, example Direct3D specifc to Windows OS and OpenGL(Open Graphis Library)</p>\r\n\r\n<p>Has two components the graphics APIs and the user interface API to interact with the user to get inputs which is independet to each other.</p>\r\n\r\n<p><strong>Graphics Pipeline:&nbsp; </strong>Is a system that consists both hardware and software&nbsp;components.</p>\r\n\r\n<p><a href=\"https://www.researchgate.net/profile/Christoph_Guetter/publication/235696712/figure/fig1/AS:299742132228097@1448475501091/The-graphics-pipeline-in-OpenGL-consists-of-these-5-steps-in-the-new-generation-of-cards.png\"><img alt=\"Graphics Pipeline\" src=\"https://www.researchgate.net/profile/Christoph_Guetter/publication/235696712/figure/fig1/AS:299742132228097@1448475501091/The-graphics-pipeline-in-OpenGL-consists-of-these-5-steps-in-the-new-generation-of-cards.png\" style=\"float:left; height:200px; width:717px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fig.1</strong>: Graphics pipline</p>\r\n\r\n<p>Operations in the pipeline map <strong>3D</strong> vertex locations to<strong> 2D</strong> screen positions and shade the triangles so that they both look realistic and appear in proper <strong>back-to-front order(z-buffer)</strong>.&nbsp;</p>\r\n\r\n<p>Geometric manuiplation used in the graphics pipeline is in a <strong>4D </strong>coordinate space represented by 4 x 4 matrices, the 4 th coordinate called homogeneous that helps with perspective viewing.&nbsp;The graphics pipeline, therefore, contains much machinery for efficiently processing and composing such matrices and vectors.<br />\r\n&nbsp;</p>\r\n\r\n<h3><strong>What is a homogenoues coordinate system and why it is so important in Computer Graphics?</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n', 'Basics-of-Computer-Graphics', '2019-12-27 22:54:52', 4, '18554665985e068bbc40778.jpg', 82, 'https://www.youtube.com/embed/01YSK5gIEYQ'),
(44, 'OpenGL', '<p>From&nbsp;<a href=\"https://learnopengl.com/\">https://learnopengl.com/</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Welcome to my humble attempt to facilitate a well-developed teaching platform for the graphics API called OpenGL. Whether you are trying to learn OpenGL for academic purposes, to pursue a career or simply looking for a hobby, this site will teach you the basics, the intermediate and all the advanced knowledge using&nbsp;<strong>modern</strong>&nbsp;(core-profile) OpenGL. The aim of LearnOpenGL is to show you all there is to modern OpenGL in an easy-to-understand fashion with clear examples, while also providing a useful reference for later studies.</p>\r\n', 'OpenGL', '2020-01-01 12:36:55', 1, '20231858195e0c92671850c.png', 82, 'https://www.youtube.com/embed/OR4fNpBjmq8'),
(45, 'Sorting', '<ul>\r\n	<li><strong>Bubble Sort</strong>.</li>\r\n	<li><strong>Insertion Sort</strong>.</li>\r\n	<li>Selection Sort.</li>\r\n	<li><strong>Quick Sort</strong>.</li>\r\n	<li><strong>Merge Sort</strong>.</li>\r\n	<li>Heap Sort.</li>\r\n</ul>\r\n', 'Sorting', '2020-01-08 13:19:06', 9, '4028548245e15d6ca8ca8b.PNG', 82, NULL),
(46, 'Bubble', '<p>Here the content</p>\r\n', 'Bubble', '2020-01-08 13:31:50', 9, '9952360395e15d9c65d3ec.png', 75, NULL),
(47, 'Ubuntu Distro', '<p>Ubuntu is a free and open-source Linux distribution based on Debian. Ubuntu is officially released in three editions: Desktop, Server, and Core. All the editions can run on the computer alone, or in a virtual machine. Ubuntu is a popular operating system for cloud computing, with support for OpenStack</p>\r\n', 'Ubuntu-Distro', '2020-02-03 19:04:32', 27, '17279700135e386ec051a97.png', 82, NULL),
(48, 'Dijkstra\'s algorithm', '<p><strong>Dijkstra&#39;s algorithm</strong>, published in 1959 and named after its <strong>creator</strong> Dutch computer scientist Edsger <strong>Dijkstra</strong>, can be applied on a weighted graph. The graph can either be directed or undirected. One stipulation to using the <strong>algorithm</strong> is that the graph needs to have a nonnegative weight on every edge</p>\r\n', 'Dijkstras-algorithm', '2020-02-04 06:55:17', 29, '18275056095e39155584b53.jpg', 82, 'https://www.youtube.com/embed/GazC3A4OQTE');
